import React, { Fragment } from 'react';
import MaterialTable from 'material-table'
import TableIcons from '../../common/materialicon'


export default class MapUserLockerManagement extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
           
        };
      
    }

    optionsTable1 = {
        search: false,
        pageSize: 20,
        pageSizeOptions: [20],
    }

    componentDidMount() {
    
    }

    render() {
        return(
            <Fragment>
                <MaterialTable
                icons ={TableIcons}
                options = {this.optionsTable1}
                title= 'Danh sách người dùng hiện tại'/>
                <MaterialTable
                icons ={TableIcons}
                title= 'Danh sách các tủ hiện tại'
                />

            </Fragment>
        )
    }
}
